import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  IconButton,
} from "@mui/material";
import LoanIconButton from "../../Common/LoanIconButton";
import CompanyModal from "../Common/CompanyModal";
import { RiSkipBackMiniFill } from "react-icons/ri";
import { BsPlus } from "react-icons/bs";
import { BiSkipNext, BiSkipPrevious } from "react-icons/bi";
import { useState } from "react";
import { IoRefresh } from "react-icons/io5";
import LoanTextField from "../../Common/LoanTextField";
const AddAccountDetail = ({
  newAccountDetials,
  accountDetial,
  handleInputChangeAccountDetial,
  handleBack,
  handleSkip,
  handleNext,
  saveAccountDetials,
}) => {
  const [isCompanyAddressModalOpen, setIsCompanyAddressModalOpen] =
    useState(false);
  function handleCompanyAddressOpenModal() {
    setIsCompanyAddressModalOpen(true);
  }
  function handleCompanyAddressCloseModal() {
    setIsCompanyAddressModalOpen(false);
  }
  return (
    <>
      <div className="flex">
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipPrevious />}
          text="Back"
          onClick={handleSkip}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BsPlus />}
          text="Add"
          onClick={handleCompanyAddressOpenModal}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipNext />}
          text="Skip"
          onClick={handleSkip}
        />
      </div>
      <CompanyModal
        isOpen={isCompanyAddressModalOpen}
        onClose={handleCompanyAddressCloseModal}
        title="Add company address information"
      >
        <div>
          <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
          
           
          </div>
          <div className="flex justify-center p-2 pt-5">
            <button
              className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={() => {
                saveAddress();
              }}
            >
              Save
            </button>
          </div>
        </div>
      </CompanyModal>
    </>
  );
};

export default AddAccountDetail;
